import React from "react";

const PorfolioProject = props => {
  return (
    <div className="profilProject">
      {props.myPortolioUn.map(portWeb => (
        <div
          className="card"
          key={portWeb.id}
          style={{ width: "23rem", height: "330px" }}
        >
          <img src={portWeb.myImg} className="card-img-top" alt="..." />
          <div className="card-body ">
            <h3 className="card-title">{portWeb.mytitle}</h3>
            <p className="card-text">{portWeb.myContent}</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default PorfolioProject;
